data:
  definition: dispositif électrique ou mécanique qui empêche la mise sous tension
    des contacts d’un connecteur avant son accouplement correct avec l’embase correspondante
    et qui empêche l’extraction du connecteur lorsque ses contacts sont sous tension
    ou annule le contact avant désaccouplement
